    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Texas and Louisiana Gulf Coast after Hurricane Rita made landfall. The regions photographed
    range from San Luis Pass, Texas to Deep Lake, Louisiana. The aerial photograph missions
    were conducted by the NOAA Remote Sensing Division the day after Rita made landfall,
    September 22 and concluded September 30. The images were acquired from an altitude
    of 7,500 feet, using an Emerge/Applanix Digital Sensor System (DSS). Over 2000 aerial
    images were obtained during this time period, with most available to view online
    and download.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
